import React, { useState, useEffect, useMemo } from 'react';
import { buildListingUrl, extractRestaurants, extractSectionTitle } from './api';
import { useApp } from './context';

const Card = ({ data, onAdd }) => {
  const info = data.info || {};
  const { cloudinaryImageId, name, cuisines = [], areaName, avgRating, sla = {}, price = 19900 } = info;
  // price is often in paise; adjust if present
  const rupees = typeof info.costForTwo === 'string'
    ? info.costForTwo
    : Math.round((info.feeDetails?.amount || price) / 100);

  return (
    <div className="cards">
      <img
        src={`https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_660/${cloudinaryImageId}`}
        alt={name}
        className="deliveryIcons"
      />
      <div>
        <h2>{name}</h2>
        <h3>⭐ {info.avgRating ?? info.avgRatingString} • {sla?.deliveryTime ?? '--'} mins</h3>
        <p>{cuisines.join(', ')}</p>
        <p>{areaName}</p>
        <button
          onClick={() =>
            onAdd({
              id: info.id,
              name,
              price: typeof rupees === 'number' ? rupees : undefined,
              cloudinaryImageId,
            })
          }
        >
          Add to Cart
        </button>
      </div>
    </div>
  );
};

const RestaurantCard = () => {
  const [list, setList] = useState([]);
  const [area, setArea] = useState('');
  const [loading, setLoading] = useState(true);
  const [rawSearch, setRawSearch] = useState('');
  const { searchTerm, setSearchTerm, addToCart } = useApp();

  // Debounce input into global searchTerm
  useEffect(() => {
    const id = setTimeout(() => setSearchTerm(rawSearch), 300);
    return () => clearTimeout(id);
  }, [rawSearch, setSearchTerm]);

  const fetchData = async () => {
    try {
      const response = await fetch(buildListingUrl(23.7956531, 86.4303859));
      const Data = await response.json();
      setArea(extractSectionTitle(Data));
      setList(extractRestaurants(Data));
    } catch (error) {
      console.error('Error fetching data:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  const filteredList = useMemo(() => {
    const q = (searchTerm || '').toLowerCase().trim();
    if (!q) return list;
    return list.filter(r => r?.info?.name?.toLowerCase().includes(q));
  }, [list, searchTerm]);

  if (loading) return <p>Loading restaurants...</p>;

  return (
    <div className="restaurantslist-container">
      <h2>{area || 'All restaurants'}</h2>
      <input
        type="text"
        placeholder="Search restaurants..."
        value={rawSearch}
        onChange={(e) => setRawSearch(e.target.value)}
        className="search-input"
        style={{
          padding: '10px',
          width: '100%',
          marginBottom: '20px',
          borderRadius: '6px',
          border: '1.5px solid #ccc',
          fontSize: '16px',
        }}
      />
      <div>
        <ul className="restaurantslist">
          <li className="restaurantslists">Filter</li>
          <li className="restaurantslists">Sort By</li>
          <li className="restaurantslists">Rating 4.0+</li>
          <li className="restaurantslists">Fast Delivery</li>
          <li className="restaurantslists">Pure Veg</li>
          <li className="restaurantslists">Offers</li>
          <li className="restaurantslists">Rs 300-600</li>
          <li className="restaurantslists">Less than 300</li>
        </ul>
      </div>
      <div className="cardcontainer">
        {filteredList.length > 0 ? (
          filteredList.map((each) => (
            <Card data={each} key={each?.info?.id} onAdd={addToCart} />
          ))
        ) : (
          <p>No restaurants match your search.</p>
        )}
      </div>
    </div>
  );
};

export default RestaurantCard;
